import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
        <div className="app">
            <header className="App-header">
                <img src={logo} className="app-logo" alt="logo" />
            </header>
            <div className="leftContainer"></div>
            <div className="rightContainer"></div>
        </div>
    );
}
export default App;
